import styles from "./Menubar.module.css";

function Menubar() {
  return (
    <>
      <div>
        <div className={styles.Menubar}>
          <div>Carrer</div>
          <div>홈</div>
          <div>튜터</div>
          <div>게시판</div>
          <div>상담</div>
        </div>
      </div>
    </>
  );
}

export default Menubar;
